import './App.css';
import React, { Component } from 'react'
import { useState } from 'react';
import { Link } from 'react-router-dom';
import PickLeagues  from './PickLeagues'

export default function Signup() {

    const [email, setEmail] = useState({
        email: '',
    });


    return (

        <div >
            <h2>Signup</h2>

            <div className="signup-form-items">
                <label htmlFor="email">Enter email</label>
                <input id="email" type="email" placeholder="Email address..."></input>
            </div>

            <div className="signup-form-items">
                <label htmlFor="password">Enter password</label>
                <input id="password" type="password" placeholder="Password..."></input>
            </div>

            <div>
            <PickLeagues email={email.email} />
            </div>

            <Link to="./">
                <button className="btn btn-dark">Go Back</button>
            </Link>

            <Link to="./PickLeagues">


                <button className="btn btn-dark">Next</button>
            </Link>


        </div>
    );
}
